-- Import 1st Bowman Cards
-- Run this in PostgreSQL

-- Get Bowman brand ID
DO $$
DECLARE
    bowman_brand_id UUID;
BEGIN
    SELECT id INTO bowman_brand_id FROM brands WHERE name = 'Bowman' LIMIT 1;

    -- Ensure 2020 Bowman Chrome exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2020 Bowman Chrome', 2020, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2020 Bowman Chrome' AND year = 2020);

    -- Ensure 2020 Bowman Draft exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2020 Bowman Draft', 2020, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2020 Bowman Draft' AND year = 2020);

    -- Ensure 2021 Bowman exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2021 Bowman', 2021, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2021 Bowman' AND year = 2021);

    -- Ensure 2021 Bowman Chrome exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2021 Bowman Chrome', 2021, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2021 Bowman Chrome' AND year = 2021);

    -- Ensure 2021 Bowman Draft exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2021 Bowman Draft', 2021, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2021 Bowman Draft' AND year = 2021);

    -- Ensure 2022 Bowman exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2022 Bowman', 2022, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2022 Bowman' AND year = 2022);

    -- Ensure 2022 Bowman Chrome exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2022 Bowman Chrome', 2022, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2022 Bowman Chrome' AND year = 2022);

    -- Ensure 2022 Bowman Draft exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2022 Bowman Draft', 2022, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2022 Bowman Draft' AND year = 2022);

    -- Ensure 2023 Bowman exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2023 Bowman', 2023, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2023 Bowman' AND year = 2023);

    -- Ensure 2023 Bowman Chrome exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2023 Bowman Chrome', 2023, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2023 Bowman Chrome' AND year = 2023);

    -- Ensure 2023 Bowman Draft exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2023 Bowman Draft', 2023, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2023 Bowman Draft' AND year = 2023);

    -- Ensure 2024 Bowman exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2024 Bowman', 2024, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2024 Bowman' AND year = 2024);

    -- Ensure 2024 Bowman Chrome exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2024 Bowman Chrome', 2024, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2024 Bowman Chrome' AND year = 2024);

    -- Ensure 2024 Bowman Draft exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2024 Bowman Draft', 2024, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2024 Bowman Draft' AND year = 2024);

    -- Ensure 2025 Bowman exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2025 Bowman', 2025, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2025 Bowman' AND year = 2025);

    -- Ensure 2025 Bowman Chrome exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2025 Bowman Chrome', 2025, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2025 Bowman Chrome' AND year = 2025);

    -- Ensure 2025 Bowman Draft exists
    INSERT INTO product_lines (name, year, brand_id, sport)
    SELECT '2025 Bowman Draft', 2025, bowman_brand_id, 'Baseball'
    WHERE NOT EXISTS (SELECT 1 FROM product_lines WHERE name = '2025 Bowman Draft' AND year = 2025);

END $$;

